		Insert into w_note (tipo,oggetto,prog,modovis,nota) VALUES (2,'W9.W9PUBBLICAZIONI-scheda.DETTPUBBLICAZIONI',2,'2','<b>ATTENZIONE:</b> Avvisiamo gli utenti che il campo URL va compilato con un indirizzo URL che punti al <b>documento oggetto di pubblicazione (formato PDF, P7M, ecc.)</b> e non a pagine generiche o a pagine indice da cui ricercare o selezionare il documento. Cliccare su <a title="Istruzioni per recuperare la URL da un sito" href="https://www.serviziocontrattipubblici.it/SPInApp/it/resources/cms/documents/manuale_utente_istruzioni_URL.pdf" target="_blank" rel="noopener">Istruzioni per recuperare la URL da un sito</a> per scaricare una breve guida. Precisiamo inoltre che tale indirizzo URL dovr&agrave; restare attivo e puntare al documento per la durata prevista della pubblicit&agrave; sul profilo di committente cos&iacute; come precisato dall''art.29 del dlgs 50/2016 e s.m.i.');
